data ranging from April 2019 - March 2020. The data is public and has been made available by Motivate International Inc. under this [License](https://ride.divvybikes.com/data-license-agreement).\n","\n","**Data Cleaning and Manipulation**\n","\n","I used R to have the data collected, wrangled, cleaned, stacked, manipulated and combined to perform my analysis. I will outline the steps with code samples to show my steps of the Data Analysis Process. "]},{"cell_type":"markdown","id":"73a6641c","metadata":{"papermill":{"duration":0.008006,"end_time":"2023-03-11T23:25:55.104368","exception":false,"start_time":"2023-03-11T23:25:55.096362","status":"completed"},"tags":[]},"source":["**Load the required analytics packages in R**\n","\n","* tidyverse for data import and wrangling\n","> * ggplot2 for visualizations\n","> * dplyr for mechanisms\n","> * readr helps read csv files\n","* magrittr provides mechanisms for chaning commands with a new forward-pipe operator, %>%\n","> * dplyr also provides a similar mechanism for chaning commands with forward-pipe operator, %>%\n","* dslabs provides datasets and functions that can be used for data analysis\n","* lubridate makes it easier to work with dates and times"]},{"cell_type":"code","execution_count":1,"id":"f2f68641","metadata":{"execution":{"iopub.execute_input":"2023-03-11T23:25:55.125474Z","iopub.status.busy":"2023-03-11T23:25:55.122757Z","iopub.status.idle":"2023-03-11T23:26:34.356734Z","shell.execute_reply":"2023-03-11T23:26:34.35415Z"},"papermill":{"duration":39.246742,"end_time":"2023-03-11T23:26:34.359278","exception":false,"start_time":"2023-03-11T23:25:55.112536","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘vctrs’\n","\n","\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘vctrs’ had non-zero exit status”\n","Warni