 need to consolidate that from four to two labels.\n","1. The data can only be aggregated at the ride-level, which is too granular. We will want to add some additional columns of data -- such as day, month, year -- that provide additional opportunities to aggregate the data.\n","1. We will want to add a calculated field for length of ride since the 2020Q1 data did not have the \"tripduration\" column. We will add \"ride_length\" to the entire dataframe for consistency.\n","1. There are some rides where tripduration shows up as negative, including several hundred rides where Divvy took bikes out of circulation for Quality Control reasons. We will want to delete these rides."]},{"cell_type":"code","execution_count":15,"id":"dea234ee","metadata":{"execution":{"iopub.execute_input":"2023-03-11T23:27:37.228219Z","iopub.status.busy":"2023-03-11T23:27:37.226559Z","iopub.status.idle":"2023-03-11T23:27:38.20014Z","shell.execute_reply":"2023-03-11T23:27:38.198276Z"},"papermill":{"duration":0.99372,"end_time":"2023-03-11T23:27:38.202455","exception":false,"start_time":"2023-03-11T23:27:37.208735","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","    casual   Customer     member Subscriber \n","     48480     786573     378407    2298051 "]},"metadata":{},"output_type":"display_data"}],"source":["# In the \"member_casual\" column, replace \"Subscriber\" with \"member\" and \"Customer\" with \"casual\"\n","# Before 2020, Divvy used different labels for these two types of riders ... we will want to make our dataframe consistent with their current nomenclature\n","# N.B.: \"Level\" is a special property of a column that is retained even if a subset does not contain any values from a specific level\n","# Begin by seeing how many observations fall under each usertype\n","\n","table(all_trips$member_casual)\n","\n","# Reassign to the desired values (we will go with the current 2020 labels)\n","all_trips <-  all_trips %>% \n","  mutate(member_casual = recode(member_casual\n","                           ,\"Subscriber\" = \"member\"\n","                           ,\"Customer\" = \"casual\"))"]},{"cell_type":"code","execution_count":16,"id":"3719aa30","metadata":{"execution":{"iopub.execute_input":"2023-03-11T23:27:38.240438Z","iopub.status.busy":"2023-03-11T23:27:38.238835Z","iopub.status.idle":"2023-03-11T23:27:38.431796Z","shell.execute_reply":"2023-03-11T23:27:38.429698Z"},"papermill":{"duration":0.215974,"end_time":"2023-03-11T23:27:38.434811","exception":false,"start_time":"2023-03-11T23:27:38.218837","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n"," casual  member \n"," 835053 2676458 "]},"metadata":{},"output_type":"display_data"}],"source":["# Check to make sure the proper number of observations were reassigned\n","table(all_trips$member_casual)"]},{"cell_type":"code","execution_count":17,"id":"087281b0","metadata":{"execution":{"iopub.execute_input":"2023-03-11T23:27:38.470717Z","iopub.status.busy":"2023-03-11T23:27:38.469033Z","iopub.status.idle":"2023-03-11T23:28:16.373801Z","shell.execute_reply":"2023-03-11T23:28:16.371981Z"},"papermill":{"duration":37.941136,"end_time":"2023-03-11T23:28:16.391897","exception":false,"start_time":"2023-03-11T23:27:38.450761","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["'data.frame':\t3511511 obs. of  15 variables:\n"," $ ride_id           : chr  \"22178529\" \"22178530\" \"22178531\" \"22178532\" ...\n"," $ started_at        : POSIXct, format: \"2019-04-01 00:02:22\" \"2019-04-01 00:03:02\" ...\n"," $ ended_at          : POSIXct, format: \"2019-04-01 00:09:48\" \"2019-04-01 00:20:30\" ...\n"," $ rideable_type     : chr  \"6251\" \"6226\" \"5649\" \"4151\" ...\n"," $ start_station_id  : int  81 317 283 26 202 420 503 260 211 211 ...\n"," $ start_station_name: chr  \"Daley Center Plaza\" \"Wood St & Taylor St\" \"LaSalle St & Jackson Blvd\" \"McClurg Ct & Illinois St\" ...\n"," $ end_station_id    : int  56 59 1